import {BrowserRouter, Route, Link} from 'react-router-dom'

//import css
import './App.css';

//import component
import {Home} from './components/home'

function App() {
  return (
    <BrowserRouter>
      <>
        <div className="App">
          <h1 className = 'title_into'>Henry Dogs</h1>
          <div className='div_buton_into'>
            <Link to='/home'>
            <a className = 'buton_into' href="">INGRESAR</a>
            </Link>
          </div>
        </div>

        <Route exact path = '/home' component = {Home} />
        <Route exact path = '/raza' component = {Home} />
        <Route exact path = '/add' component = {Home} />
      </>
    </BrowserRouter>
  );
}

export default App;
